import React from 'react'
import {
    BrowserRouter as Router,
    Routes, 
    Route, 
    Link
} from 'react-router-dom'
import PagesPromotionSearch from './Promotion/Search/Search'

const Root = () => {
    <Router>
        <Routes>
            <Route path="/" component={PagesPromotionSearch}/>
        </Routes>
    </Router>
}

export default Root;
